import React from 'react';
import { useParams } from 'react-router-dom';
import { getNote } from '../services/note';

const Detail = () => {
  const { id } = useParams();

  useEffect(() => {
    getNote(id)
      .then(res => {
        console.log(res);
      });
  }, []);

  return (
    <div>
      <h1>Note: {id}</h1>
    </div>
  );
};

export default Detail;
